import React, { Component } from 'react';

class AddDriver extends Component {
    render() {
        return (
          <form id="add-driver">
            <div className="field">
              <label>First Name:</label>
              <input type="text" />
            </div>
            <div className="field">
              <label>Last Name:</label>
              <input type="text" />
            </div>
            <div className="field">
                <label>Nationality:</label>
                <input type="text" />
            </div>
            <div className="field">
                <label>Team</label>
                <select>
                    <option>Select Team</option>
                </select>
            </div>
            <button>Add</button>
          </form>
        );
    }
}

export default AddDriver;
